import logo from './logo.svg';
import './App.css';

function App() {
  const testData = 
    {
      "id":1,
      "english":"Hello!",
      "chinese":"你好！",
      "pinyin":"nǐhǎo!"
    }
  ;
  return (
    <div className="App">
      <h3>English: {testData.english}</h3>
      <h3>Pinyin: {testData.pinyin}</h3>
      <h3>Chinse: {testData.chinese}</h3>
    </div>
  );
}

export default App;
